head automatic door, spacious back garden, en-suite bathrooms and built-in wardrobes.\n\n\nAmenities:\n\n\nLAUNDRY ROOM\nMAID&#39;S ROOM\nHIGH-END FITTINGS\nEN-SUITE BATHROOMS\nBUILT-IN WARDROBES\nEXPANSIVE OUTDOOR TERRACES\nSPACIOUS BACK GARDEN\nSPORTS COURT\nFULLY-EQUIPPED GYM\nCOMMUNITY SWIMMING POOL\nCYCLING &amp; JOGGING TRACK","url":"https:\/\/www.propertyfinder.ae\/en\/plp\/rent\/villa-for-rent-dubai-nadd-al-sheba-nad-al-sheba-3-10071641.html","image":"https:\/\/www.propertyfinder.ae\/property\/c07840bc83009ff245ed97f0fd9c1adf\/668\/452\/MODE\/30b4ff\/10071641-1955co.jpg?ctr=ae","offers":[{"@type":"Offer","offeredBy":{"@type":"RealEstateAgent","name":"Ramy Elmenyawy","url":"www.propertyfinder.ae\/en\/agent\/ramy-elmenyawy-188206","sameAs":["https:\/\/en.wikipedia.org\/wiki\/Real_estate_agent","www.propertyfinder.ae\/en\/agent\/ramy-elmenyawy-188206"],"image":"https:\/\/www.propertyfinder.ae\/broker\/4\/178\/98\/MODE\/3513ef\/1948-logo.jpg?ctr=ae","parentOrganization":{"@type":"Organization","address":"None","url":"www.propertyfinder.ae\/en\/broker\/nakheel-1948","name":"Nakheel"},"telephone":"97143903333"},"businessFunction":"http:\/\/purl.org\/goodrelations\/v1#LeaseOut","priceSpecification":{"@type":"UnitPriceSpecification","price":260000,"priceCurrency":"AED","unitText":"Yearly"}}],"address":{"@type":"PostalAddress","name":"Nad Al Sheba 3","addressRegion":"Nad Al Sheba 3","addressLocality":"dubai"},"geo":{"@type":"GeoCoordinates","latitude":25.156074,"longitude":55.375196},"telephone":"+971565097345","floorSize":{"@type":"QuantitativeValue","value":382,"unitText":"sqm"},"amenityFeature":[]}}]
