y brands, Nakheel is bringing new concepts to Dubai in line with the government\u2019s tourism vision. Joint venture partners currently include Spain\u2019s RIU Hotels & Resorts and Thailand\u2019s Centara Hotels & Resorts, under which two resorts at Deira Islands will be delivered in 2020. The St. Regis Dubai \u2013 The Palm, part of Nakheel\u2019s Palm Tower hotel and residential complex at the heart of Palm Jumeirah, is also due to open this year. Nakheel\u2019s hospitality project collection also includes a range of community clubs and restaurants.\r\n\r\n \r\n\r\nNakheel\u2019s residential leasing portfolio currently comprises 17,000 villas and apartments at The Gardens, Discovery Gardens, Jebel Ali Village, Nad Al Sheba, Palm Jumeirah, Badrah, Veneto and International City.", "license_label": "RERA", "license_number": "1234567", "location_name": "Dubai", "transactions_count": 0, "agents": 0, "total_properties": 56, "properties_residential_for_rent_count": 53, "properties_residential_for_sale_count": 0, "properties_commercial_count": 3, "client_type": "developer", "is_verified": false }, "links": { "profile": "\/en\/broker\/nakheel-1948", "logo_178_98": "https:\/\/www.propertyfinder.ae\/broker\/4\/178\/98\/MODE\/3513ef\/1948-logo.jpg?ctr=ae", "logo_desktop": "https:\/\/www.propertyfinder.ae\/images\/pf_broker\/logo\/8cd5c8f6a0b1e99e6e32020faf3332db58bb861a\/desktop" } }, { "type": "property_type", "id": "35", "attributes": { "name": "Villa", "key": "villa", "dfp_key": "Villa", "abbreviation": "VH", "published": true, "order": 6 } }, { "type": "property_category", "id": "2", "attributes": { "full_name": "Residential for Rent", "short_name": "For rent", "name": "Rent", "key": "rent" } }, { "type": "agent", "id": "188206", "attributes": { "user_id": "53975", "name": "Ramy Elmenyawy", "image_token": "https:\/\/www.propertyfinder.ae\/images\/pf_agent\/picture\/2ab9be39980519a5542b6230ca29e64f409f90c3\/desktop", "phone": "+971568462575", "phone_user": "+971568462575"