ginal, 70km coastline, paving the way for the development of hundreds of seafront homes, resorts, hotels and attractions. Nakheel\u2019s master developments span 15,000 hectares, accommodate nearly 300,000 people and provide a growing range of destinations, attractions and facilities for Dubai\u2019s residents and tourists. They include Palm Jumeirah, The World, Jumeirah Islands, Jumeirah Park, Jumeirah Village, Al Furjan, The Gardens, Discovery Gardens, Jebel Ali Village, Dragon City, Nad Al Sheba, Warsan Village, International City and the upcoming Deira Islands \u2013 a new destination for tourism, living and leisure at Dubai\u2019s oldest, most traditional trading hub.\r\n\r\n \r\n\r\nNakheel Malls, the company\u2019s retail arm, owns and operates a range of assets including large-scale malls, dining and entertainment destinations and community shopping centres. Operational assets, with six million square feet of retail space, include Ibn Battuta Mall, Dragon Mart, Nakheel Mall, Golden Mile Galleria, The Pointe and Club Vista Mare, with West Beach at Palm Jumeirah, The Night Market, Warsan Souk, Al Khail Avenue, The Circle Mall, Nad Al Sheba Mall and others at various stages of construction and development.\r\n\r\n \r\n\r\nNakheel Hospitality\u2019s project portfolio comprises a range of hotels and resorts, from five star, luxury establishments to modest accommodation. The first four \u2013 Premier Inn Ibn Battuta Mall, Avani Ibn Battuta, ibis Styles Dragon Mart and Premier Inn Dragon Mart \u2013 are operational, with others under construction. Working with international, reputable hospitality brands, Nakheel is bringing new concepts to Dubai in line with the government\u2019s tourism vision. Joint venture partners currently include Spain\u2019s RIU Hotels & Resorts and Thailand\u2019s Centara Hotels & Resorts, under which two resorts at Deira Islands will be delivered in 2020. The St. Regis Dubai \u2013 The Palm, part of Nakheel\u2019s Palm Tower hotel and residential complex at the heart of Palm Jumeirah, is also due to open this year. Nakheel\u2019s hospitality project collection also includes a range of community clubs and restaurants.\r\n\r\n \r\n\r\nNakheel\u2019s residential leasing portfolio currently comprises 17,000 villas and apartments at The Gardens, Discovery Gardens, Jebel Ali Village, Nad Al Sheba, Palm Jumeirah, Badrah, Veneto and International City.", "license_label": "RERA", "license_number": "1234567", "location_name": "Dubai", "transactions_count": 0, "agents": 0, "total_properties": 56, "properties_residential_for_rent_count": 53, "properties_residential_for_sale_count": 0, "properties_commercial_count": 3, "client_type": "developer", "is_verified": false }, "links": { "profile": "\/en\/broker\/nakheel-1948", "logo_178_98": "https:\/\/www.propertyfinder.ae\/broker\/4\/178\/98\/MODE\/3513ef\/1948-logo.jpg?ctr=ae", "logo_desktop": "https:\/\/www.propertyfinder.ae\/images\/pf_broker\/logo\/8cd5c8f6a0b1e99e6e32020faf3332db58bb861a\/desktop" } }, { "type": "property_type", "id": "1", "attributes": { "name": "Apartment", "key": "apartment", "dfp_key": "Apartment", "abbreviation": "AP", "published": true, "order": 1 } }, { "type": "property_category", "id": "2", "attributes": { "full_name": "Residential for Rent", "short_name": "For rent", "name": "Rent", "key": "rent" } }, { "type": "location", "id": "1", "attributes": { "name": "Dubai", "path": "1", "path_name": "", "location_type": "CITY", "review_score": 1.9703567, "reviews_count": 6566, "image_token": "", "coordinates": { "lon": 55.266774, "lat": 25.119581 }, "level": 0, "abbreviation": "", "current_language_slug": "dubai", "url_slug": "dubai", "children_count": 6808, "age": null, "is_tower_insights_visible": false, "is_community_insights_visible": false, "floors": 0, "polygon": [], "polygon_center_points": null, "categories": null, "tower_entry_image": "", "community_entry_image": "", "images": null }, "links": { "tower_insights_url": "", "community_in